import './App.css';
import Signup from './pages/Signup/Signup'
import Navbar from './layout/navbar/Navbar'
import { Route, Switch } from 'react-router-dom';


function App() {
  return (
<>
    <Navbar />
      <h1>HOLA</h1>
      <main>
        <Switch>
          <Route path="/registro" render={props => <Signup storeUser={this.setTheUser} {...props} />} />
        </Switch>
      </main>

</>
  );
}

export default App;
<Route path="/registro" render={props => <Signup storeUser={this.setTheUser} {...props} />} />
